import { Icon } from "@/lib/icon";
import { mdiCog, mdiHome } from "@mdi/js";
import { Tabs, TabsContent, TabsList, TabsTrigger } from "@/components/ui/tabs";

export default function LineVariantWithIconsDemo() {
